// Components

import Layout from '../components/Layout';
import PostLink from '../components/PostLink'
import Title from '../components/Title'
import ScrollPanel from '../components/ScrollPanel'

// Content
import AboutMePanel from './posts/AboutMePanel'
import VoyPanel from './posts/VoyPanel'

export default function Blog() {
  return (
    <Layout>
      <Title><a>kiet <b>Ho</b></a></Title>

      <ScrollPanel>
        <AboutMePanel/>
      </ScrollPanel>

      <ScrollPanel title={<h1><b>Voy </b>Audio Tour</h1>}>
        <VoyPanel/>
      </ScrollPanel>

      <ScrollPanel title={<h1><b>AI </b>Projects</h1>}>
      </ScrollPanel>

      <ScrollPanel title={<h1><b>Hack</b>athon</h1>}>
      </ScrollPanel>
      <style jsx> {`
        h1{
          font-weight : lighter;
          font-size: 30px;
          font-size: 4vh;
          padding-left: 2vw;
        }
      `} </style>

    </Layout>
  );
}
